          "message": "chore(converter): scope postings to series with chunks in interval (#108)\n\nIf we happen to converter a one day block out of a 14 day TSDB block we\ncould run into a situation where we decode and iterate over series that\nwe know dont have chunks in the particular day we are interested in,\ni.e. because of churn.\nThis change makes it so we just skip those series without looking at any\nchunks.\n\nSigned-off-by: Michael Hoffmann <mhoffmann@cloudflare.com>",
